import React, { useState } from "react";
import "../css/Roulette.css";
import SpinningWheel from "react-spinning-wheel";

const options = [
  { value: 10, text: "10x" },
  { value: 0, text: "Nu ai castigat" },
  { value: 2, text: "2x" },
  { value: 0, text: "Nu ai castigat" },
  { value: 1, text: "1x" },
  { value: 15, text: "15x" },
  { value: 0, text: "Nu ai castigat" },
  { value: 0, text: "Nu ai castigat" },
];

function Roulette() {
  return (
    <div className="roulette">
      <SpinningWheel
        options={options}
        onComplete={(option) => console.log("Selected option: ", option)}
      />
    </div>
  );
}

export default Roulette;
